   list:[]
}
let TodoReducer=(state=initialState,action)=>{
switch(action.type){
    case "To_Add":{
        return {list:[...state.list,action.payload]}
    }
    // default :{
    //     return{state}
    // }  
}
}
export default TodoReducer;
